import React from 'react';
import FormRegistro from './componentes/FormRegistro';
import FormLogin from './componentes/FormLogin';

const App = () => {
  return (
    <div>
      <h1>Registro usuario</h1>
      <FormRegistro />

      <h1>Iniciar Sesion</h1>
      <FormLogin />
    </div>
  );
};

export default App;
